INSERT INTO `tag` VALUES (2,'c#','C# is a multi-paradigm programming language encompassing strong typing, imperative, declarative, functional, generic, object-oriented (class-based), and component-oriented programming disciplines.',0,'',0,'','2014-05-29 15:19:38',826,'\0'),(4,'ruby','Ruby is a multi-platform open-source dynamic object-oriented interpreted language created by Yukihiro Matsumoto (Matz) in 1993.',0,'',0,'','2014-05-29 15:19:38',472,'\0'),(5,'javascript','JavaScript (not to be confused with Java) is a dynamically-typed language commonly used for client-side scripting. Use this tag for questions regarding ECMAScript and its various dialects/implementations (excluding ActionScript). Unless a tag for a framework/library is also included, a pure JavaScript answer is expected.',0,'',0,'','2014-05-29 15:19:38',2669,'\0'),(8,'asp.net','ASP.NET is a Microsoft web application development framework that allows programmers to build dynamic web sites, web applications and web services. ',0,'',0,'','2014-05-29 15:19:38',377,'\0'),(9,'.net','The .NET framework is a software framework designed mainly for the Microsoft Windows operating system. It includes an implementation of the Base Class Library, Common Language Runtime (commonly referred to as CLR) and Dynamic Language Runtime. It supports many programming languages, including C#, VB.NET, F# and C++/CLI.\r\n',0,'',0,'','2014-05-29 15:19:38',549,'\0'),(11,'azure','Microsoft Azure (formerly Windows Azure) is a Platform as a Service (PaaS) and Infrastructure as a Service (IaaS) cloud computing platform by Microsoft. Users of the platform can deploy their applications onto cloud hosting benefiting from on-demand service, elastic scale, and a highly managed environment on a pay-as-you-go basis.',0,'',0,'','2014-05-29 15:19:38',137,'\0'),(13,'visual-studio','Visual Studio is an integrated development environment (IDE) from Microsoft. It supports many different programming languages.',0,'',0,'','2014-05-29 15:19:38',306,'\0'),(17,'nodejs','Node.js® is a platform built on Chrome\'s JavaScript runtime for easily building fast, scalable network applications. Node.js uses an event-driven, non-blocking I/O model that makes it lightweight and efficient, perfect for data-intensive real-time applications that run across distributed devices.',0,'',0,'','2014-05-29 15:19:38',1001,'\0'),(18,'knockout','an open source JavaScript library for dynamic HTML UIs using the Model-View-View Model (MVVM) pattern.',0,'',0,'','2014-05-29 15:19:38',84,'\0'),(24,'linq','Language Integrated Query (LINQ) is a Microsoft .NET Framework component that adds native data querying capabilities to .NET languages.',0,'',0,'2','2014-05-29 15:19:38',154,'\0'),(45,'jquery','jQuery is a popular cross-browser JavaScript library that facilitates DOM (HTML Structure) traversal, event handling, animation and AJAX interactions by minimizing the discrepancies across browsers and providing an easy-to-use API.',0,'',0,'5','2014-05-29 15:19:38',1149,'\0'),(108,'xamarin','Xamarin is a software company, which is created by the engineers behind Mono, Xamarin.iOS (formerly called MonoTouch), Xamarin.Android (formerly called Mono for Android), Xamarin.Mac (and the opensource MonoMac) and Xamarin Studio (and the open source MonoDevelop).\r\n\r\n',0,'',0,'','2014-05-29 15:19:38',95,'\0'),(121,'roslyn','A version of the C# and VB compilers that is written in managed code.',0,'',0,'2,9','2014-05-29 15:19:38',31,'\0'),(126,'android','Android is Google&#39;s OS for digital devices[Phone, Tablet, Auto, TV, Watch]. Please use Android-specific tags such as android-intent, not intent. For non-developer/programming questions, use http://android.stackexchange.com',0,'',0,'','2014-05-29 15:19:38',463,'\0'),(127,'eclipse','Eclipse is an open source IDE with plugins available to support a large variety of languages. This tag should only be used for questions specifically about the Eclipse IDE and not for generalized programming topics.',0,'',0,'','2014-05-29 15:19:38',104,'\0'),(133,'xcode','Xcode is Apple&#39;s integrated development environment (IDE). This tag should only be used for questions about Xcode itself, and not for general Mac or iOS programming topics. Use [cocoa] for Mac programming questions, and [cocoa-touch] or [ios] for iOS programming questions.',0,'',0,'','2014-05-29 15:19:38',174,'\0'),(139,'ios','iOS is Apple&#39;s operating system for mobile devices, such as the iPhone, iPod touch, iPad and Apple TV (2nd generation and up). Much is shared with OS X, but iOS is optimized for touch-based interfaces.',0,'',0,'','2014-05-29 15:19:38',351,'\0'),(149,'wordpress','WordPress is an open source content management system running on PHP and MySQL, and often used as a blog engine. WordPress questions about programming and administration are best asked on http://wordpress.stackexchange.com/',0,'',0,'','2014-05-29 15:19:38',569,'\0'),(152,'signalr','ASP.NET SignalR is a new library for ASP.NET developers that makes it incredibly simple to add real-time web functionality to your applications. What is &quot;real-time web&quot; functionality? It&#39;s the ability to have your server-side code push content to the connected clients as it happens, in real-time.',0,'',0,'','2014-05-29 15:19:38',40,'\0'),(153,'css','CSS (Cascading Style Sheets) is a language used to control the visual presentation of HTML and XML documents including (but not limited to) colors, layout, and fonts.',3,'',0,'','2014-05-29 15:19:38',2372,'\0'),(161,'sharepoint','For SharePoint-specific questions, please see the SharePoint Stack Exchange (http://sharepoint.stackexchange.com) site. Use this tag for programming questions which may involve SharePoint.\r\nMicrosoft SharePoint is a platform and a family of software products developed by Microsoft for collaboration and web publishing.',0,'',0,'','2014-05-29 15:19:38',25,'\0'),(164,'nhibernate','NHibernate is a mature, open source object-relational mapper (ORM) for the .NET framework.\r\n',0,'',0,'','2014-05-29 15:19:38',15,'\0'),(172,'asp.net-mvc','The ASP.NET MVC Framework is an open source web application framework and tooling that implements a version of the model-view-controller (MVC) pattern tailored towards web applications and built upon an ASP.NET technology foundation.',0,'',0,'8','2014-05-29 15:19:38',402,'\0'),(200,'php','PHP is a general-purpose scripting language widely used in web development.',0,'',0,'','2014-05-29 15:19:38',1251,'\0'),(209,'owin','Open Web Interface for .NET',0,'',0,'','2014-05-29 15:19:38',32,'\0'),(217,'unity','The Unity Application Block (Unity) is a lightweight, extensible dependency injection container for .NET with support for interception. ',0,'',0,'','2014-05-29 15:19:38',97,'\0'),(284,'orchard','a free, open source, community-focused Content Management System built on the ASP.NET MVC platform.',0,'',0,'8','2014-05-29 15:19:38',13,'\0'),(302,'oxite','Open source, web standards compliant, blog engine built on ASP.NET MVC.',0,'',0,'','2014-05-29 15:19:38',8,'\0'),(335,'visual basic','Visual Basic .NET (VB.NET) is an object-oriented computer programming language that can be viewed as an evolution of Microsoft\'s Visual Basic 6 (VB6) but implemented on the Microsoft .NET Framework.',0,'',0,'','2014-05-29 15:19:38',10,'\0'),(337,'vb','Visual Basic .NET (VB.NET) is an object-oriented computer programming language that can be viewed as an evolution of Microsoft\'s Visual Basic 6 (VB6) but implemented on the Microsoft .NET Framework.',0,'',0,'','2014-05-29 15:19:38',38,'\0'),(829,'entity-framework','The ADO.NET Entity Framework is a set of Object-Relational-Mapping (ORM) tools for the .NET  Framework, since version 3.5 SP1.',0,'',0,'','2014-05-29 15:19:38',183,'\0'),(830,'angularjs','AngularJS is an open-source JavaScript framework. Its goal is to augment browser-based applications with Model–View–Whatever(MV*) capability and reduce the amount of JavaScript needed to make web applications functional. These types of apps are also frequently known as Single-Page Applications.',0,'',0,'','2014-05-29 15:19:38',972,'\0'),(1518,'ruby-on-rails','Ruby on Rails is an open source full-stack web application framework written in Ruby. It follows the popular MVC framework model and is known for its &quot;convention over configuration&quot; approach to application development.',0,'',0,'4','2014-05-29 15:19:38',370,'\0'),(1559,'interface-design','Interface design deals with the process of developing a method for two (or more) modules in a system to connect and communicate. These modules can apply to hardware, software or the interface between a user and a machine.',0,'',0,'28','2014-05-29 15:19:38',242,'\0'),(1992,'mysql','MySQL is an open-source, relational database management system. If your issue relates to MySQLi, use the MySQLi tag instead.',0,'',0,'','2014-05-29 15:19:38',373,'\0'),(2056,'java','Java is a general-purpose programming language designed to be used in conjunction with the Java Virtual Machine (JVM). &quot;Java platform&quot; is the name for a computing system that has installed tools for developing and running Java programs. Use this tag for questions referring to Java programming language or Java platform tools.',0,'',0,'','2014-05-29 15:19:38',594,'\0'),(2218,'python','Python is a dynamic and strongly typed programming language that is designed to emphasize usability. Two similar but incompatible versions of Python are in widespread use (2 and 3). Please consider mentioning the version and implementation that you are using when asking a question about Python.',0,'',0,'','2014-05-29 15:19:38',556,'\0'),(2219,'coffeescript','CoffeeScript is a little language that compiles into JavaScript. Underneath all of those embarrassing braces and semicolons, JavaScript has always had a gorgeous object model at its heart. CoffeeScript is an attempt to expose the good parts of JavaScript in a simple way.',0,'',0,'','2014-05-29 15:19:38',130,'\0'),(2220,'c++','C++ is a general-purpose programming language based on C. Use this tag for questions about code compiled with a C++ compiler, regardless of whether the code could be valid in C, C#, Objective-C and other C based programming languages.',0,'',0,'','2014-06-08 22:39:47',235,'\0'),(2221,'swift','Swift is a programming language designed by Apple for creating iOS and OS X apps. Swift retains some elements from C and Objective-C, but offers many modern features such as generics, closures, optionals, tuples, type inference, and operator overloading.',0,'',0,'','2014-06-10 23:30:30',312,'\0'),(2222,'sql','Structured Query Language (SQL) is a language for querying databases. Questions should include code examples and table structure, and include a tag for the DBMS implementation (e.g. MySQL, PostgreSQL, Oracle, MS SQL Server) being used. If your question relates to a specific DBMS (uses specific extensions/features), use that DBMS&#39;s tag instead. Answers to questions tagged with SQL should use ANSI SQL as much as possible.',0,'',0,'','2014-06-24 01:06:21',409,'\0'),(2225,'delphi','Delphi is a language for rapid development of native Windows, OS X, iOS, and Android applications through use of Object Pascal. The name refers to the Delphi language as well as its IDE, which is used to help edit and debug Delphi projects.',0,'',0,'','2014-07-03 23:56:08',12,'\0'),(2231,'backbone','Backbone.js is a JavaScript library that provides structure to RESTful web applications.',0,'',0,'','2014-07-12 00:02:20',186,'\0'),(2232,'ember.js','Ember.js is an advanced HTML5 MVC application framework written in JavaScript and distributed under an open source license.  Click learn more... and use the preconfigured templates from the tag wiki in order to create better questions.',0,'',0,'','2014-07-12 00:03:00',28,'\0'),(2233,'c','C is a general-purpose computer programming language used for operating systems, libraries, games and other high performance work and is clearly distinct from C++. It was developed in 1972 by Dennis Ritchie for use with the Unix operating system.',0,'',0,'','2014-07-12 00:06:25',104,'\0'),(2234,'objective-c','This tag should be used only on questions that are about Objective-C features or depend on code in the language. The tags &quot;cocoa&quot; and &quot;cocoa-touch&quot; should be used to ask about Apple&#39;s frameworks or classes. Use the related tags [ios] and [osx] for issues specific to those platforms.',0,'',0,'','2014-07-12 00:06:58',202,'\0'),(2237,'sass','Sass (Syntactically Awesome Stylesheets) is an extension of CSS adding features like nested rules, variables and mixins. This extends the possibility to write structured, manageable and reusable CSS. Sass translates to standard CSS.',1,'',0,'','2014-07-12 00:52:33',617,'\0'),(2238,'heroku','',0,'',0,'','2014-07-12 00:54:26',17,'\0'),(2240,'common-lisp','Common Lisp, or ANSI Common Lisp, is a standardized version of the Lisp programming language intended for production-strength power and libraries.',0,'',0,'','2014-07-15 13:08:24',13,'\0'),(2241,'groovy','Groovy is an object-oriented programming language for the Java platform. It is a dynamic language with features similar to those of Python, Ruby, Perl and Smalltalk. It can be used as a scripting language for the Java platform.',0,'',0,'','2014-07-15 14:32:23',49,'\0'),(2248,'lua','Lua is a powerful, fast, lightweight, embeddable scripting language. It&#39;s dynamically typed, runs by interpreting bytecode and has automatic garbage collection. It is often referred to as an &quot;extensible extension language&quot;.',0,'',0,'','2014-08-05 07:28:40',14,'\0'),(2250,'kockoutjs','Knockout.js is an open source JavaScript library for dynamic HTML UIs using the Model-View-View Model (MVVM) pattern.',0,'',0,'','2014-08-05 14:54:05',14,'\0'),(2252,'git','Git is an open-source distributed version control system (DVCS).\r\n',0,'',0,'','2014-08-05 18:41:44',533,'\0'),(2253,'contao','Contao is a PHP based 